import React from 'react';


function footer() {
  return (
    <div>
       <footer className="bottom">
        <div className="center">
        <p>
  All rights reserved &copy; <span style={{ color: 'red' }}>Siddhartha Komakula</span> 2023
</p>

        </div>
       
    </footer>
    </div>
  );
}

export default footer;
